import axios from 'axios';
export default {
  components: {},
  data() {
    return {
      ebikeparts: []
    };
  },
  created() {
    this.getData();
  },
  methods: {
    async getData() {
      try {
        const inv = await axios.get('getData');
        this.ebikeparts = inv.data;
      } catch (error) {
        console.log(error);
      }
    }
  }
};
